import ReactDOM from "react-dom";
import Card from "../Card/Card";
import {Link} from "react-router-dom";
import Header from "../Header/Header";
import Footer from "../Footer/Footer";

class About extends Component {
    constructor(props) {
        super(props);
    }
    componentDidMount() {

    }

    render() {
        return(
            <>
                <Header number="3"/>
                <div className="content">
                    <h3 align="center">Творческое задание</h3>
                    <p align="center">Творческое задание по дисциплине "ППИ"</p>
                    <p align="center">В ходе выполнения творческого задания были выполнены следующие задачи</p>
                </div>
                <Footer/>
            </>
        )
    }


}

export default About;
